import {useLocation} from "react-router-dom";
import Table from 'react-bootstrap/Table';

export default function () {
    const location = useLocation();

    if (location.state !== null) {
        let {orderItems} = location.state;
        return (
            <Table>
                <thead>
                    <tr>
                        <th>Item Name</th>
                        <th>Order Price</th>
                        <th>Count</th>
                    </tr>
                </thead>

                <tbody>
                    <tr></tr>


                </tbody>
            </Table>
        )

    } else {
        return (
            <div>ERROR</div>
        )
    }


}
